arges are calculated inclusively. For example, if you pick up the device on a Thursday and return it on a Monday, you will be charged for 5 days of usage - You can purchase optional insurance for your pocket WiFi. If the device is missing or damaged, the insurance can reduce the charges - You can also rent a battery pack which will extend the device battery life - Please obey Fair Usage Policy (policy for the fair use of data communication): Under the Fair Usage Policy, users who deal with large amounts of data in a short period of time might, without prior notice, have their data use limited at the discretion of the telecommunications company they are subscribed to. Please refrain from watching videos for a long time, etc., or from using a huge amount of data in such a short period. Telecom Square will in no way be responsible or liable for the incurred data limit as per above, and you will still be charged with the appropriate fees during your rental period. *Please Notice:* - For flights from 9:30pm-8:00am, please choose the home delivery option - If you choose home delivery or pick up at Kaohsiung Airport for your WiFi device you will be required to place your order at least 6 days prior to your departure date. For example, if you are due to depart on 10 June, the latest date for placing an order will be 4 June. - If you choose pick up the device at Taoyuan Airport or at Songshan Airport for your WiFi device you will be required to place your order at least 4 days prior to your departure date. For example, if you depart on 10 June, the latest date for placing an order will be 6 June.","title":"4G WiFi (TW Airport Pick Up) for Singapore","lastUpdated":"2017-06-19T09:47:25Z","dateCreated":"2017-06-19T09:47:24Z","id":690,"ticketTypeGroups":[{"isOpenDated":null,"code":"02","orderFulfillment":null,"applyCapacity":false,"showTypeName":true,"questions":[{"id":4921,"class":"globaltix.api.Question"},{"id":4920,"class":"globaltix.api.Question"}],"description":"Your ticket