ari - Fast and friendly service connecting you to top Singapore attractions: Singapore Zoo, Night Safari and River Safari - Enjoy direct bus service with pick ups from most hotels and various locations - Choose from 4 transfer options (1 or 2 way trip, or a full 1 or 2 day pass) - Enjoy [breakfast at Singapore Zoo](https://www.klook.com/activity/140-singapore-zoo-breakfast-singapore/), opt for [tram rides or dinner at the Night Safari](https://www.klook.com/activity/1411-night-safari-package-add-ons-singapore/), or savour on a[ panda pau set at the River Safari](https://www.klook.com/activity/3648-river-safari-panda-pau-set-singapore/)","hoursOfOperation":"**Inclusive Of:** - SAEx Transfers to/from Singapore city center to Wildlife Reserves Singapore **Routes:** *Blue Line* - Pick up from: Singapore Botanic Gardens Coach Bay, Hotel Jen Tanglin, The Regent Singapore, Orchard Hotel, Royal Plaza on Scotts, Sheraton Towers, Grand Hyatt Singapore, Mandarin Orchard, Concorde Hotel, Hotel Rendevous, Hotel Grand Pacific, BIG Hotel, Little India Arcade (next to 7-Eleven), Farrer Park MRT, Quality Hotel, Ibis Singapore Novena *Orange Line* - Pick up from: Lavender MRT, Landmark Village Hotel, Intercontinental Hotel, Raffles Hotel, Pan Pacific Hotel, Singapore Flyer, Mandarin Oriental, Swissotel Stamford, Peninsula Excelsior Hotel, Hong Lim Park, Beary Best Hostel, Hotel Miramar **Package Options:** - 1 Way Trip - 2 Way Trip (same day) - 1 Day Pass - Multiple trips in 24 hours - 2 Day Pass - Multiple trips in 48 hours (over 2 consecutive days) - Passes can be used on both Orange and Blue Lines **Additional Information** - Child ticket: Age 3-12 - Infants below 3 years old do not require a ticket - 2 way trips must be used on the same day - Trips to Jurong Bird Park available on weekends and public holidays, please mention to the bus driver upon boarding","title":"City Transfers to Wildlife Reserves Singapore","lastUpdated":"2017-06-19T19:08:33Z","dateCreated":"2017-06-19T19:08