s of Resorts World Sentosa in Singapore - Come face-to-face with gentle and playful bottlenose dolphins - Play some dolphin games, practice some tricks and learn to communicate with the dolphins - Experience the thrill of being propelled through the water by one of these adorable creatures in the Dolphin Adventure - Learn about the dolphins environment, the threats to their daily life, and discover a thing or two about their anatomy","hoursOfOperation":"**Inclusive Of:** - Your choice of Dolphin Interaction Program or Dolphin Observer ticket - One day pass to Adventure Cove Waterpark - Complimentary use of lockers, towels, wetsuits and flotation devices **Package Options:** - Dolphin Discovery Interaction Program - 90 min (incl. 30 min pool experience without swimming with dolphins) - Dolphin Adventure Swimming Program - 80 min (incl. 20 min pool experience with swimming with dolphins) - Dolphin Observer ticket (without pool experience) - Dolphin Observer must be bought with a Dolphin Discovery or Adventure ticket - this can not be bought alone - Please note: All packages are only available for foreigners **Scheduling:** - Dolphin Discovery: 10:30am, 11:30am, 1:30pm, 2:30pm, 4:30pm, 5:00pm - Dolphin Adventure: 12:30pm, 3:30pm - Select your preferred time at check out. Please note that time slots are subject to availability and your allocated slot may not be your initial preference **Additional Information** - Child ticket: Age 4 – 12 (inclusive) - Senior ticket: Age 60 years and above - An observers ticket is available for those wanting to watch the activity but not get involved - Suitable for non-swimmers. Flotation devices are optional - Wetsuits will be provided for all programs - Personal photography and video are not allowed - Professional photographers are available onsite and will provide photographs for a fee GUESTS: - Will be required to shower prior to entering any pool or experiencing any attractions - Must be at least 110cm in height to participate - Children below 110cm in height must be accompanieed by a paying adult participant - If age 20 and below, must have a parent or guardian (21 years old and above) to authorize participation - If age 12 and below, must be accompanied in the water by a paying adult participant - There must be no more than 3 children accompanied by 1 adult **Important reminders:** - Bring appropriate swimwear to be worn under wetsuit (Swimwear Policy can be found [here](http://www.rwsentosa.com/LinkClick.aspx?file-ticket=8JvxuTHnWhc%3d&tabid=1390&language=en-US)) - DO NOT apply any type of tanning oil or sunscreen before entering the water - Do not bring any food and drinks into the par","title":"Dolphin Island Interaction Programs","lastUpdated":"2017-06-19T05:21:32Z","dateCreated":"2017-06-19T05:21:31Z","id":432,"ticketTypeGroups":[{"isOpenDated":null,"code":"01","orderFulfillment":null,"applyCapacity":false,"showTypeName":true,"questions":[{"id":2195,"class":"globaltix.api.Question"},{"id":2194,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","customName":1,"_key":"01,1,432,,","howToUse":[],"products":[{"id":1144,"class":"com.globaltix.api.v1.Product"},{"id":1145,"class":"com.globaltix.api.v1.Product"},{"id":1143,"class":"com.globaltix.api.v1.Product"}],"attraction":{"id":432,"class":"com.globaltix.api.v1.Attraction"},"series":[],"isAddOn":0,"name":"Dolphin Discovery","currency":{"id":3,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":null,"visitDate":null,"id":962,"class":"com.globaltix.api.v1.TicketTypeGroup","cancellationPolicy":null,"inclusions":[]},{"isOpenDated":null,"code":"00","orderFulfillment":null,"applyCapacity":false,"showTypeName":true,"questions":[{"id":2182,"class":"globaltix.api.Question"},{"id":2183,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","customName":1,"_key":"00,1,432,,","howToUse":[],"products":[{"id":1140,"class":"com.globaltix.api.v1.Produ