magePath":"69a117a6-1e6c-4cf0-b654-d8a3b20d98d0","postalCode":null,"latitude":null,"description":"Tour around the island resort of Sentosa on an eco-friendly Segway to enjoy scenic views, encounter famous landmarks and explore sun-kissed beaches - Try out the newest trend on this futuristic personal mobility device with a 5-10 min Segway taster or on a 30 min tour - Get to grips with the vehicles on 2 rounds of the practice circuit - Cruise around Sentosa with a friendly local guide who will give you guidance and instruction on riding a Segway - Glide to several stunning beaches: Silosa, Palawan and Tanjong","hoursOfOperation":"**Package Options:** *Segway Fun Ride* - 2 rounds on the practice circuit (5-10 min) - Instructor guidance - First-come-first served basis - Riders below the age of 10 will be accompanied by a walking guide - Operating hours: 10:00am-7:30pm daily (last entry 7:15pm) *Segway Eco Adventure* - Scenic 30 min guided ride accompanied by trainers - Visit Sentosas Siloso or Palawan beach - Basic segway training included - Minimum age is 10 years old - Operating hours: 10:00am-7:30pm daily (last ride 6:30pm) **Additional Information:** - Participants must be over 42in (105cm) tall and weigh no more than 264lbs (120kg) - A Complete Release of Liability form must be signed before commencement of Segway rides. All guests below 18 years old must have their form signed by their guardian. Please obtain the form from the friendly Segway staff - You are required to bring a Photo ID and the operator reserves the right to request for identification documents to verify age claims and to deny access without proof of age - Smoking, using mobile devices and consumption of food and drinks are strictly prohibited during the ride - For your own safety, guests with the following conditions will not be allowed to ride, including but not limited to: heart conditions or abnormal blood conditions, extreme vertigo, recent surgery or easily aggravated conditions, expectant m