abounce or Parajump - S.E.A. Aquarium - K-Live Sentosa - Segway Fun Ride - Sentosa Merlion - Skyline Luge Sentosa (1 Luge & 1 Skyride) - Trick Eye Museum Singapore - Tiger Sky Tower - Wave House Sentosa: Catch-A-Wave (1 Try) - Wings of Time (Standard Seat) - Images of Singapore LIVE - Madame Tussauds Singapore - MOSH! **Additional Information:** - **Please note that this pass does not include access to Sentosa Cable Car - Sentosa Line** - Wings of Time tickets must be redeemed at Sentosa Ticketing Counters prior to show - S.E.A. Aquarium and K-Live Sentosa must be redeemed together. This will be counted as two attraction redemptions - Images of Singapore LIVE & Madame Tussauds Singapore must be redeemed together and cannot be visited separately. This will be counted as two attraction redemptions - Each attraction is limited to a one-time entry unless otherwise stated - Sentosa FUN pass must be utilised within the day the first attraction is redeemed - Pass is valid during the attractions usual operating hours or until closure of attractions, whichever is earlier - Please refer [here](https://store.sentosa.com.sg/tnc) for the respective attractions height, weight, age and other restrictions - Child price is applicable to children aged 3-12 years inclusive","title":"Sentosa FUN Pass","lastUpdated":"2017-06-19T13:17:51Z","dateCreated":"2017-06-19T13:17:50Z","id":879,"ticketTypeGroups":[{"isOpenDated":null,"code":"00","orderFulfillment":null,"applyCapacity":false,"showTypeName":true,"questions":[{"id":6871,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","customName":1,"_key":"00,1,879,,","howToUse":[],"products":[{"id":2692,"class":"com.globaltix.api.v1.Product"},{"id":2693,"class":"com.globaltix.api.v1.Product"}],"attraction":{"id":879,"class":"com.globaltix.api.v1.Attraction"},"series":[],"isAddOn":0,"name":"Play Max Pass","currency":{"id":3,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":null,"visitDate