n both the Sentosa Line and Mount Faber Line - Spacious cabin designed to be friendly for wheelchairs and baby strollers *Sky Pass + Buffet* - Sky Pass - Lunch buffet at Spuds and Aprons Restaurant OR dinner buffet at Good Old Days Restaurant - Click [here](http://res.klook.com/image/upload/v1494673594/GOLDSpudsApronsBuffetMenu_khywdl.pdf) to view menu **Operating Hours:** *Cable Car* - Cable car operating hours: 8:45am-10:00pm (last ride at 9:30pm) - Each one-way trip is approx. 15 minutes in duration *Spuds and Aprons Lunch Buffet* - Daily 12:00pm-2:30pm (last seating 2:00pm) *Good Old Days Dinner Buffet* - Daily 5:00pm-10:00pm (last seating 9:15pm) **Cable Car Route:** *Mount Faber Line* - Mount Faber Station (for Mount Faber) - HarbourFront Station (for VivoCity, HarbourFront MRT) - Sentosa Station (for transfer to Sentosa Line at Imbiah Lookout) *Sentosa Line* - Imbiah Lookout (for [Skyline Luge](https://www.klook.com/activity/132-skyline-luge-singapore/), [Adventureland](https://www.klook.com/activity/136-sentosa-4d-adventureland-singapore/), [MegaZip](https://www.klook.com/activity/713-megazip-singapore/), [Madame Tussauds](https://www.klook.com/activity/1182-madame-tussauds-singapore/)) - Merlion Station (for Sentosa Merlion, [S.E.A Aquarium](https://www.klook.com/activity/119-sea-aquarium-singapore/), [Universal Studios Singapore](https://www.klook.com/activity/117-universal-studios-singapore/)) - Siloso Point Station: (for Fort Siloso, Siloso Beach) **Additional Information:** - Child ticket: Age 4-12 - Children 3 years and below can board for free - No outside food and drinks are permitted","title":"Singapore Cable Car Skypass","lastUpdated":"2017-06-19T05:16:21Z","dateCreated":"2017-06-19T05:16:20Z","id":427,"ticketTypeGroups":[{"isOpenDated":null,"code":"01","orderFulfillment":null,"applyCapacity":false,"showTypeName":true,"questions":[{"id":2143,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","cu