e lots of awesome photos with the city skyline as your backdrop from the buss open air upper deck!","hoursOfOperation":"**Package Options:** - 2 Day Singapore City Pass - 3 Day Singapore City Pass - The main difference between the 2 and 3 Day Passes is that there are more attractions available for 3 Day Pass holders *2 Day Pass:* - FunVee Wow Night Tour (reservations required) - 2 Day FunVee Hopper Pass - 2 admission tickets to any of the attractions listed: [Trick Eye Museum](https://www.klook.com/activity/118-trick-eye-museum-singapore/), [River Safari](https://www.klook.com/activity/124-singapore-river-safari-singapore/), [2-Way Cable Car](https://www.klook.com/activity/130-faber-peak-cable-car-singapore/), [Gardens by the Bay](https://www.klook.com/activity/127-gardens-by-the-bay-singapore/), [Jurong Bird Park](https://www.klook.com/activity/123-jurong-bird-park-singapore/), [Tiger Sky Tower](https://www.klook.com/activity/1184-tiger-sky-tower-singapore/), [MINT Museum of Toys](https://www.klook.com/activity/1651-mint-museum-toys-singapore/), [Captain Explorer DUKw Tour](https://www.klook.com/activity/1357-captain-explorer-dukw-tour-singapore/) (reservation required), 1-Altitude Viewing Gallery, [Mdm Tussands](https://www.klook.com/activity/1182-madame-tussauds-singapore/), [Segway Fun Ride (3 rounds)](https://www.klook.com/activity/106-sentosa-segway-tour-singapore/), [Luge & Skyride](https://www.klook.com/activity/132-skyline-luge-singapore/), [Megajump](https://www.klook.com/activity/713-megazip-singapore/), Sentosa Bike Rental (2 hours) *3 Day Pass* - FunVee Wow Night Tour (reservations required) - 2 Day FunVee Hopper Pass - Singapore River Boat Tour - 2 admission tickets to any of the attractions available to the 2 Day Pass above and the following: [S.E.A Aquarium](https://www.klook.com/activity/119-sea-aquarium-singapore/), [Sands SkyPark](https://www.klook.com/activity/1584-marina-bay-sands-skypark-observation-deck-singapore/), [Night Safari](https://www.klook.com/activity/122-singapore-night-safari-singapore/), [Sentosa 4D AdventureLand](https://www.klook.com/activity/136-sentosa-4d-adventureland-singapore/), [Singapore Zoo](https://www.klook.com/activity/141-singapore-zoo-singapore/), [Adventure Cove Waterpark ](https://www.klook.com/activity/120-adventure-cove-waterpark-singapore/) **Additional Information:** - Child ticket: Age 3-12","title":"Singapore City Pass - 2/3 Days","lastUpdated":"2017-06-19T10:26:06Z","dateCreated":"2017-06-19T10:26:05Z","id":733,"ticketTypeGroups":[{"isOpenDated":null,"code":"00","orderFulfillment":null,"applyCapacity":false,"showTypeName":true,"questions":[{"id":5255,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","customName":1,"_key":"00,1,733,,","howToUse":[],"products":[{"id":2153,"class":"com.globaltix.api.v1.Product"},{"id":2152,"class":"com.globaltix.api.v1.Product"}],"attraction":{"id":733,"class":"com.globaltix.api.v1.Attraction"},"series":[],"isAddOn":0,"name":"Singapore City Pass - 2 Days","currency":{"id":3,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":null,"visitDate":null,"id":1678,"class":"com.globaltix.api.v1.TicketTypeGroup","cancellationPolicy":null,"inclusions":[]},{"isOpenDated":null,"code":"01","orderFulfillment":null,"applyCapacity":false,"showTypeName":true,"questions":[{"id":5259,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","customName":1,"_key":"01,1,733,,","howToUse":[],"products":[{"id":2155,"class":"com.globaltix.api.v1.Product"},{"id":2154,"class":"com.globaltix.api.v1.Product"}],"attraction":{"id":733,"class":"com.globaltix.api.v1.Attraction"},"series":[],"isAddOn":0,"name":"Singapore City Pass - 3 Days","currency":{"id":3,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":null,"visitDate":null,"id":1679,"class":"com.globaltix.api.v1.TicketTypeGroup","cancellationPolicy":null,"inclusions":[]}],"email":null,"longitude":null,"f